  (function() {
    var button = document.getElementById('toggleAllBtn');
    if (!button) return;
    
    var container = button.closest('.toggle-btn-container');
    if (!container || !container.previousElementSibling) return;

    var table = container.previousElementSibling.querySelector('.accordion-table');
    if (!table) return;

    var collapsibleRows = table.querySelectorAll('.collapsible-content');
    if (collapsibleRows.length === 0) {
        button.style.display = 'none';
        return;
    };

    var isExpanded = false;
    
    button.addEventListener('click', function() {
      isExpanded = !isExpanded;
      for (var i = 0; i < collapsibleRows.length; i++) {
        var row = collapsibleRows[i];
        if (isExpanded) {
            row.style.display = 'table-row';
        } else {
            row.style.display = 'none';
        }
      }
      this.textContent = isExpanded ? '접기' : '더보기 (' + collapsibleRows.length + '개)';
    });
  })();
